import React, { useEffect, useState } from 'react';

function Paper() {
    const [data, setData] = useState({
        case_array: [],
        range_input_array: [],
        type_point_array: [],
        option_array: [],
        subject_id,
        part,
    });

    useEffect(() => {
        // ดึงข้อมูลจาก backend
        fetch('http://127.0.0.1:5000/get_parts_data')
            .then((response) => response.json())
            .then((data) => setData(data))
            .catch((error) => console.error('Error fetching data:', error));
    }, []);

    return (
        <div>
            <h1>ข้อมูล Parts</h1>
            <p>Subject ID: {data.subject_id}</p>
            <p>Part: {data.part}</p>
            <div>
                <h2>Case Array</h2>
                <ul>{data.case_array.map((item, index) => <li key={index}>{item}</li>)}</ul>
            </div>
            <div>
                <h2>Range Input Array</h2>
                <ul>{data.range_input_array.map((item, index) => <li key={index}>{item}</li>)}</ul>
            </div>
            <div>
                <h2>Type Point Array</h2>
                <ul>{data.type_point_array.map((item, index) => <li key={index}>{item}</li>)}</ul>
            </div>
            <div>
                <h2>Option Array</h2>
                <ul>{data.option_array.map((item, index) => <li key={index}>{item}</li>)}</ul>
            </div>
        </div>
    );
}

export default Paper;
